import { request } from "../lib/datocms";
const query = `query Test() {
  person {
    bio
    image {
      url
    }
    name
  }
}`;

export async function getStaticProps() {
  const data = await request({
    query: query
  });
  return {
    props: { data }
  };
}

export default function Test({ data }) {
  return <div>{JSON.stringify(data, null, 2)}</div>;
}
